legend.onApiReady = function() {
    // var span = legend.getComponentsByName('game-score')[0].surfaceElement.querySelector('span');
    // span && (span.innerHTML = 100);

    function updateAction(idx) {
        slideActions.forEach(function (actions, slideIdx) {
            if (slideIdx !== idx) {
                actions && actions.forEach(function (action) {
                    action.dispose();
                });
            }
            else {
                actions && actions.forEach(function (action) {
                    action.init();
                });
            }
        });
    }

    updateAction(legend.render.slider.slideIndex);

    legend.render.slider.on('slideChanged', function (idx) {
        currentIndex = idx;
        updateAction(idx);
    });
};

