function createSnowDropEffect() {
    return {
        dispose: function () {

            if (!this.chart) {
                return;
            }
            this.chart.dispose();
            this.chart = null;

        },

        init: function () {
            if (this.chart) {
                return;
            }

            var dom = legend.getComponentsByName('snow-drop-' + legend.render.slider.slideIndex)[0].surfaceElement;
            var chart = this.chart = echarts.init(dom);

            var snowDrops = [];

            var canvas = document.createElement('canvas');
            canvas.width = canvas.height = 50;
            var circleCtx = canvas.getContext('2d');
            circleCtx.beginPath();
            circleCtx.arc(25, 25, 15, 0, Math.PI * 2);
            circleCtx.shadowColor = '#fff';
            circleCtx.shadowBlur = 15;
            circleCtx.fillStyle = '#fff';
            circleCtx.fill();

            function SnowDrop(size, speed, position, life) {
                this._el = new echarts.graphic.Image({
                    style: {
                        image: canvas,
                        x: -canvas.width / 2,
                        y: -canvas.height / 2
                    },
                    scale: [size / 20, size / 20],
                    position: position
                });

                this._opacity = size / 8;

                this._speed = speed;

                this.restLife = life;
            }

            SnowDrop.prototype.getEl = function () {
                return this._el;
            }

            SnowDrop.prototype.update = function (time) {
                this._el.position[0] += this._speed[0] * time;
                this._el.position[1] += this._speed[1] * time;

                this._el.style.opacity = this._opacity;

                this._el.dirty();

                this.restLife -= time;
                if (this.restLife < 0) {
                    return true;
                }
            };

            function spawnSnowDrop() {
                var size = Math.random() * 8 + 2;
                var speed = size * 20;

                var snowDrop = new SnowDrop(
                    size, [Math.random(), speed],
                    [zr.getWidth() * Math.random(), -Math.random() * 10],
                    4 + Math.sqrt(10 - size)
                );

                snowDrops.push(snowDrop);
                return snowDrop;
            }

            var zr = chart.getZr();

            zr.animation.on('frame', function (dTime) {
                dTime /= 1000;
                // spawn
                if (Math.random() < 0.1) {
                    for (var i = 0; i < 1; i++) {
                        var snowDrop = spawnSnowDrop();
                        zr.add(snowDrop.getEl());
                    }
                }
                snowDrops.forEach(function (snowDrop) {
                    snowDrop.update(dTime / 1000);
                });
                // Update
                snowDrops = snowDrops.filter(function (snowDrop) {
                    var needsRemove = snowDrop.update(dTime);
                    if (needsRemove) {
                        zr.remove(snowDrop.getEl());
                    }
                    return !needsRemove;
                });
            });
        }
    };
}

