var fenceWave = {

    dispose: function () {
        if (!this.chart) {
            return;
        }
        this.chart.dispose();
        this.chart = null;

        clearInterval(this.interval);
    },

    init: function () {
        if (this.chart) {
            return;
        }

        var dom = legend.getComponentsByName('fence')[0].surfaceElement;
        var chart = this.chart = echarts.init(dom);

        var BIN_SIZE = 16;
        var FFT_ZERO = 128; // zero position in fft
        var FFT_MAX = 165;
        var FFT_MIN = 110;

        var audioData = [];
        var maxData = [];

        initChart();

        if (!soundSource) {

            var stopButton = legend.getComponentsByName('audio-on')[0].surfaceElement;
            var playButton = legend.getComponentsByName('audio-off')[0].surfaceElement;

            soundSource = new Audio();
            soundSource.src = fenceSong;
            soundSource.loop = true;
            soundSource.play();
            startUpdateChart(fenceFFT);

            var oldVolume;
            playButton.addEventListener('click', function () {
                soundSource.play();
                // if (oldVolume) {
                //     soundSource.volume = oldVolume;
                // }
            });
            stopButton.addEventListener('click', function () {
                soundSource.pause();
                // oldVolume = soundSource.volume;
                // soundSource.volume = 0;
            });
        }
        else {
            hasWebAudio && startUpdateChart(fenceFFT);
        }

        function startUpdateChart(fft) {
            fenceWave.interval = setInterval(function () {
                var time = soundSource.currentTime * 1000;
                var min = Infinity;
                var foundFrame;
                for (var i = 0; i < fft.length; i++) {
                    var frame = fft[i];
                    if (Math.abs(frame.t - time) < min) {
                        foundFrame = frame;
                        min = Math.abs(frame.t - time);
                    }
                }
                newData = [];
                for (var i = 0; i < foundFrame.d.length; ++i) {
                    maxData[i] = Math.max(Math.max(maxData[i] - 0.001, foundFrame.d[i]) - FFT_ZERO, 0);
                    newData.push(foundFrame.d[i]);
                }
                audioData = newData;

                chart.setOption({
                    series: [{
                        data: newData
                    }, {
                        data: maxData
                    }]
                });
            }, 250);
        }

        function initChart() {
            chart.setOption({
                series: [{
                    type: 'bar',
                    data: (function () {
                        var data = [];
                        maxData = [];
                        for (var i = 0; i < BIN_SIZE; ++i) {
                            data.push(FFT_ZERO);
                            maxData.push(0);
                        }
                        return data;
                    })(),
                    stack: 'wave',
                    barCategoryGap: '30%',
                    barGap: '-100%',
                    itemStyle: {
                        normal: {
                            barBorderRadius: 5,
                            color: '#fff'
                        }
                    },
                    barMinHeight: 20
                }, {
                    type: 'bar',
                    data: (function () {
                        var data = [];
                        for (var i = 0; i < BIN_SIZE; ++i) {
                            data.push(0);
                        }
                        return data;
                    })(),
                    stack: 'wave',
                    silent: true,
                    itemStyle: {
                        normal: {
                            color: 'transparent'
                        }
                    },
                    barMinHeight: 4
                }, {
                    type: 'bar',
                    data: (function () {
                        var data = [];
                        for (var i = 0; i < BIN_SIZE; ++i) {
                            data.push(0);
                        }
                        return data;
                    })(),
                    stack: 'wave',
                    silent: true,
                    itemStyle: {
                        normal: {
                            barBorderRadius: 5,
                            color: '#fff'
                        }
                    },
                    barMinHeight: 4
                }],
                xAxis: {
                    min: 0,
                    max: BIN_SIZE,
                    show: false,
                    data: (function () {
                        var data = [];
                        for (var i = 0; i < BIN_SIZE; ++i) {
                            data.push(i + '');
                        }
                        return data;
                    })()
                },
                yAxis: {
                    show: false,
                    min: FFT_MIN,
                    max: FFT_MAX
                },
                grid: {
                    left: 0,
                    right: 0,
                    top: 0,
                    bottom: 0
                }
            });
        }
    }
}

