game.gameOver = function () {

    var childrenCnt;
    if (window.game.score === 0) {
        childrenCnt = 0;
    }
    else {
        childrenCnt = Math.floor((window.game.score + Math.random()) * 100);
    }

    var span = legend.getComponentsByName('game-score')[0].surfaceElement;
    span.innerHTML = childrenCnt;
    span.style.fontSize = '26px';
    span.style.color = 'rgb(237,79,72)';
    span.style.textAlign = 'center';

    legend.render.gotoPage(15);

};

var gamePage = {
    init: function () {

        game.init(legend.getComponentsByName('game-stage')[0].surfaceElement);
    },
    dispose: function () {
        game.dispose();
    }
};

